import{_ as e,c as a,o,aj as i,bS as l,bT as s,bU as r,bV as n,bW as d,bX as c,aC as u,aD as p,bY as h,bZ as m,b_ as g,b$ as y}from"./chunks/framework.D6_Aedov.js";const S=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"soundCloud.md","filePath":"soundCloud.md"}'),f={name:"soundCloud.md"};function _(b,t,v,x,w,k){return o(),a("div",null,[...t[0]||(t[0]=[i('<h2 id="_1-preparation" tabindex="-1">1. Preparation <a class="header-anchor" href="#_1-preparation" aria-label="Permalink to “1. Preparation”">​</a></h2><p>Before using the SoundCloud music service, you need to prepare a valid SoundCloud account.</p><p>For first-time users, please open SoundCloud in the &quot;Streaming - Music&quot; menu on your device and follow the prompts to log in.</p><p>Reminder: The music content on SoundCloud is user-generated, and its core listening mechanism relies on users uploading their own audio or following other creators to listen to their works.</p><img src="'+l+'" alt=""><h2 id="_2-log-in" tabindex="-1">2. Log In <a class="header-anchor" href="#_2-log-in" aria-label="Permalink to “2. Log In”">​</a></h2><p>Please enter your SoundCloud account and password on your device to log in.</p><p>If you haven&#39;t created a SoundCloud account yet, please register on the SoundCloud official website: <a href="https://soundcloud.com/upload" target="_blank" rel="noreferrer">https://soundcloud.com/upload</a></p><img src="'+s+'" alt=""><h2 id="_3-browsing" tabindex="-1">3. Browsing <a class="header-anchor" href="#_3-browsing" aria-label="Permalink to “3. Browsing”">​</a></h2><p>After successfully logging in, you can browse SoundCloud on your device or the Eversolo Control APP. At the homepage, you will see sections for Liked tracks, Liked playlist, My tracks, My playlist, Followers, Following.</p><p>You can browse these categories layer by layer to access various SoundCloud music recommendations. In My tracks section, you can also view all the works you have uploaded, making it easier to manage and play.</p><div class="two-images"><img src="'+r+'" alt=""><img src="'+n+'" alt=""></div><h2 id="_4-search" tabindex="-1">4. Search <a class="header-anchor" href="#_4-search" aria-label="Permalink to “4. Search”">​</a></h2><p>Click the search box at the top to search the entire SoundCloud music library for Tracks, Playlists, People and other content you want, quickly locating your desired music resources.</p><div class="two-images"><img src="'+d+'" alt=""><img src="'+c+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div><h2 id="_5-more" tabindex="-1">5. More <a class="header-anchor" href="#_5-more" aria-label="Permalink to “5. More”">​</a></h2><p>In the browsing interface, you can access the more functions menu by clicking the &quot;<img class="imgIcon" src="'+u+'" alt="">&quot; icon to the right of the track, or the &quot;<img class="imgIcon" src="'+p+'" alt="">&quot; icon in the upper right corner of the album/playlist.</p><p>This menu supports the following functions:</p><table tabindex="0"><thead><tr><th style="text-align:left;">More menus for singles</th><th style="text-align:left;">More menus for albums/playlists</th></tr></thead><tbody><tr><td style="text-align:left;">Play now / Play next</td><td style="text-align:left;">Play all tracks now</td></tr><tr><td style="text-align:left;">Add to the end of play queue</td><td style="text-align:left;">Add all tracks to the next play</td></tr><tr><td style="text-align:left;">Add to device playlist</td><td style="text-align:left;">Add all tracks to the end of play queue</td></tr><tr><td style="text-align:left;">Favorite to SoundCloud</td><td style="text-align:left;">Add to device playlist</td></tr><tr><td style="text-align:left;">Add to SoundCloud playlist</td><td style="text-align:left;">/</td></tr><tr><td style="text-align:left;">View artist</td><td style="text-align:left;">/</td></tr><tr><td style="text-align:left;">View comments</td><td style="text-align:left;">/</td></tr></tbody></table><p><strong>Tips:</strong></p><ul><li>Saved content can be viewed and managed at any time in the My tracks / My playlist section.</li><li>Content added to the device playlist can be viewed and managed centrally in My Music- Device playlists.</li></ul><div class="two-images"><img src="'+h+'" alt=""><img src="'+m+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div><h2 id="_6-streaming-quality" tabindex="-1">6. Streaming Quality <a class="header-anchor" href="#_6-streaming-quality" aria-label="Permalink to “6. Streaming Quality”">​</a></h2><p>When playing SoundCloud music, the device outputs directly according to the specifications of the current audio source, and the streaming quality entirely depends on the original files on this platform.</p><p>Maximum support</p><ul><li>PCM 768kHz/32bit</li></ul><div class="two-images"><img src="'+g+'" alt=""><img src="'+y+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div>',31)])])}const P=e(f,[["render",_]]);export{S as __pageData,P as default};
